description:
While babysitting Jenna gets a call from her boyfriend saying that he's going out with a different girl. So she calls her friend Jean (James) and asks him to come over to help her ease her mind. Jasmine (Carmen) arrives late for her babysitting job which really annoys Mr. Lockwood. While he is explaining stuff to her he gets the impression that she has no experience. But to his surprise she has tons of it. Mr. Wilson (Manuel) asks Erika (Dillion) to come and see him after class. She then finds out that he is offering her a babysitting job based on her grades. Mr. Wilson later finds out that she is good at more than just babysitting. Mr. Davis (Erik) arrives home late from a meeting and gives his sitter Tinslee a ride home. Once arriving home Tinslee and Mr. Davis discuss what's bothering him. That's When things really start to heat up.

